using System;
using System.Drawing;
using Polyglot;
using UnityEngine;
using Graphics = System.Drawing.Graphics;

namespace PlaylistLoaderLite
{
    public class CustomPlaylistSO : ScriptableObject, IPlaylist, IAnnotatedBeatmapLevelCollection
	{
		public const String DEFAULT_IMAGE = "data:image/jpeg;base64,";
		public const int imageWidth = 1024;
		public const int imageHeight = 1024;
		public static CustomPlaylistSO CreateInstance(String name, String coverImage, CustomBeatmapLevelCollectionSO beatmapLevelCollection)
		{
			CustomPlaylistSO customPlaylistSO = ScriptableObject.CreateInstance<CustomPlaylistSO>();
			customPlaylistSO._playListLocalizedName = name;
			byte[] imageBytes;
			try
			{
				imageBytes = Convert.FromBase64String(coverImage.Substring(coverImage.IndexOf(",") + 1));
			}
			catch (Exception)
			{
				imageBytes = Convert.FromBase64String(DEFAULT_IMAGE.Substring(DEFAULT_IMAGE.IndexOf(",") + 1));
			}
            try
            {
				imageBytes = ResizeImageBytes(imageBytes);
			}
			catch (Exception) { }
			Texture2D tex = new Texture2D(1024, 1024);
			tex.LoadImage(imageBytes);
			customPlaylistSO._coverImage = Sprite.Create(tex, new Rect(0.0f, 0.0f, tex.width, tex.height), new Vector2(0f, 0f), imageHeight);
			customPlaylistSO._beatmapLevelCollection = beatmapLevelCollection;
			return customPlaylistSO;
		}

		public static CustomPlaylistSO CreateInstance(String name, Sprite coverImage, CustomBeatmapLevelCollectionSO beatmapLevelCollection)
		{
			CustomPlaylistSO customPlaylistSO = ScriptableObject.CreateInstance<CustomPlaylistSO>();
			customPlaylistSO._playListLocalizedName = name;
			customPlaylistSO._coverImage = coverImage;
			customPlaylistSO._beatmapLevelCollection = beatmapLevelCollection;
			return customPlaylistSO;
		}

		public string collectionName
		{
			get
			{
				return Localization.Get(this._playListLocalizedName);
			}
		}

		public Sprite coverImage
		{
			get
			{
				return this._coverImage;
			}
		}

		public IBeatmapLevelCollection beatmapLevelCollection
		{
			get
			{
				return this._beatmapLevelCollection;
			}
		}

		[SerializeField]
		protected string _playListLocalizedName;

		[SerializeField]
		protected Sprite _coverImage;

		[SerializeField]
		protected CustomBeatmapLevelCollectionSO _beatmapLevelCollection;

		private static byte[] ResizeImageBytes(byte[] imageBytes) // Used for scaling image to appropriate resolution
        {
			// Convert byte array to image
			ImageConverter converter = new ImageConverter();
			Image image = (Bitmap)converter.ConvertFrom(imageBytes);

			// Resize Image
			Bitmap newImage = new Bitmap(imageWidth, imageHeight);
			Graphics graphics = Graphics.FromImage(newImage);
			graphics.DrawImage(image, 0, 0, imageWidth, imageHeight);
			graphics.Dispose();
			image.Dispose();

			// Convert Image to bytes
			imageBytes = (byte[])converter.ConvertTo(newImage, typeof(byte[]));
			newImage.Dispose();
			return imageBytes;
		}
	}
}